import React from 'react';
import {Text , StyleSheet} from 'react-native';

const Screen = () => {
    return <React.Fragment>
        <Text style={style.textStyle}> hello world  </Text>
    </React.Fragment> ;
}
const style = StyleSheet.create({
    textStyle : {
        fontSize : 30
    }
});
export default Screen ;
